  \"necedah-national-wildlife-refuge-annual-narrative-report-fiscal-year-1998-2002\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Necedah
  National Wildlife Refuge outlines Refuge accomplishments during the 1998 - 2002
  fiscal year. The report begins with an introduction to the Refuge. Highlights are
  summarized for the year. Information about monitoring and studies- including surveys
  and censuses and studies and investigations- is provided next. Habitat restoration
  and management projects are also covered; activities include water level management,
  moist soil management, mowing, farming, timber management, prescribed burning, and
  vegetation control. Fish and wildlife management are discussed next with emphasis
  on bird banding, disease monitoring, reintroductions, nest structures, and animal
  control. Coordination activities, such as interagency coordination, tribal coordination,
  and private land activities, are outlined. The resource protection section provides
  an update on law enforcement, permits, contaminant investigation, water rights,
  cultural resource management, and land acquisition support. Information about public
  education and recreation is given including visitor services and outreach. Finally,
  comprehensive management planning and general administration are discussed in the
  Refuge planning and administration section. Refuge brochures and newspaper articles
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
